css:
.diagnostics-popup {
  background: #333;
  padding-right: 10px;
  padding-left: 10px;
  max-width: 500px;
  white-space: normal;
  word-wrap: break-word;
  z-index: 4;
}
.diagnostics-gutter-popup .diagnostics-popup {
  box-shadow: 0px 1px 4px 0px #000000;
}
.diagnostics-popup-header {
  display: flex;
  justify-content: space-between;
  margin-left: -10px;
  margin-right: -10px;
  padding: 4px 10px;
}
.diagnostics-popup-diagnostic {
  color: #aaa;
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
}
.diagnostics-popup-error .diagnostics-popup-header {
  background-color: rgba(204, 0, 0, 0.2);
}
.diagnostics-popup-warning .diagnostics-popup-header {
  background-color: rgba(255, 152, 45, 0.2);
}
.diagnostics-popup-info .diagnostics-popup-header {
  background-color: rgba(82, 147, 216, 0.2);
}
.diagnostics-popup-message {
  padding: 4px 0;
}
.diagnostics-popup-trace {
  padding-bottom: 4px;
}
